import React from 'react';
import GoalForm from './Components/GoalForm'
import Goals from './Components/Goals'

const dummyData = [
  {
    name: 'lose weight',
    daysLeft: 10,
    completion: 100,
    hoursPerDay: 2
  },
  {
    name: 'eat less',
    daysLeft: 10,
    completion: 100,
    hoursPerDay: 2
  },
  {
    name: 'work out every day',
    daysLeft: 10,
    completion: 100,
    hoursPerDay: 2
  }
]

function App() {
  return (
    <div className="App">
      <GoalForm />
      <Goals goals={dummyData}/>
    </div>
  );
}

export default App;
